      font-weight: strong;\n      font-family: courier;\n    }\n    .section_heading {\n      background-color: #DEDFDE;\n      text-transform: uppercase;\n      font-weight: bold;\n      text-align: center;\n      font-size: 14px;\n    }\n    .answer_space {\n      height: 32px;\n      vertical-align: top;\n    }\n    .option_block {\n      border:1px solid black;\n      padding: 5px 10px;\n      margin: 0px;\n      float:left;\n      min-width: 10px;\n      line-height: 8px;\n      min-height: 8px;\n    }\n    .empty {\n      margin-right: 10px;\n    }\n    .question {\n      float:left;\n      margin-right: 3px;\n    }\n    table {\n      font-size: 11px;\n    }\n    table td {\n      padding: 0px 1px;\n    }\n</style>\n<body>\n  <table border="1" style="width: 100%; border: 1px #DEDFDE solid;" cellspacing="0" cellpadding="0">\n    <tr>\n      <td colspan="12" style="text-align: center;font-size:16px;"><strong>National Department of Health: Malaria Elimination Programme</strong></td>\n    </tr>\n    <tr>\n      <td colspan="12" style="text-align: center;;font-size:16px;"><strong>Malaria Case Investigators Report</strong></td>\n    </tr>\n    <tr class="answer_space">\n      <td colspan="4" style="width: 33%">Case Number:</td>\n      <td colspan="4" style="width: 33%; text-align: center;"><img style="width: 10em;margin-left: auto; margin-right:auto;" src="http://qa-malaria24.za.prk-host.net/static/ona/img/logo.png"/></td>\n      <td colspan="4" style="width: 33%">Date Form Received for data capturing:</td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section A: General information on case to be investigated</td>\n    </tr>\n    <tr>\n      <td colspan="12">1. Diagnosis Date:</td>\n    </tr>\n    <tr>\n      <td colspan="6">2a. Patient's Name: <span class="variable"><strong>ma</strong></span></td>\n      <td colspan="6">2b. Surname: <span class="variable"><strong>sho</strong></span></td>\n    </tr>\n    <tr>\n      <td colspan="4">3. Age: <span class="variable"><strong>38</strong></span></td>\n      <td colspan="4">4. Date of birth: <span class="variable"><strong>1977-11-06</strong></span></td>\n      <td colspan="4">5. Gender: <span class="variable"><strong>male</strong></span></td>\n    </tr>\n    <tr>\n      <td colspan="6">6. Reporting Health Facility: <span class="variable"><strong>Middelplaas Clinic</strong></span></td>\n      <td colspan="6">7. Province: <span class="variable"><strong>Mpumalanga</strong></span></td>\n    </tr>\n    <tr class="answer_space">\n      <td colspan="6">8. Date notification form was sent/collected from health facility: <span class="variable"><strong>Tue 24 Nov 2015</strong></span></td>\n      <td colspan="6">9. Date notification form captured in MIS:</td>\n    </tr>\n    <tr>\n      <td colspan="12"><span class="question">10. Treatment given to patient:</span>\n        <div class="option_block">ACT</div><div class="option_block">Oral Quinine</div><div class="option_block">IV Artesunate</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section B: Case Investigator Detail &amp; Investigation Address</td>\n    </tr>\n    <tr>\n      <td colspan="4">1a. Name of Case Investigator:</td>\n      <td colspan="4">1b. Surname:</td>\n      <td colspan="4">1c. Investigation Date:</td>\n    </tr>\n    <tr>\n      <td colspan="12"><span class="question">3a. Case Investigation Status:</span>\n        <div class="option_block">Traced</div><div class="option_block">Untraceable</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="12">3b. If the case was untraceable, please indicate the reason:<br/>\n      <span class="question">Incomplete details of address. Cannot go out to trace.</span><div class="option_block empty"></div>\n      <span class="question">Visited, but patient not found</span><div class="option_block empty"></div>\n      <span class="question">Migrant</span><div class="option_block empty"></div>\n      <span class="question">Other</span><div class="option_block" style="width: 110px;"></div>\n    </tr>\n    <tr class="answer_space">\n      <td colspan="12">4a. Exact residential address (include name of area / section / zone / homestead number) where the patient was visited by the case investigator\n      <br/><span class="variable"><strong>School / river</strong><span>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="6">4b. Locality / village: <span class="variable"><strong>Nkomazi</strong></span></td>\n      <td colspan="6">4c. Municipality: <span class="variable"><strong>Nkomazi</strong></span></td>\n    </tr>\n    <tr>\n      <td colspan="6">4d. District: <span class="variable"><strong>Ehlanzeni</strong></span></td>\n      <td colspan="6">5. Patient's contact number: <span class="variable"><strong>0722237504</strong></span></td>\n    </tr>\n    <tr>\n      <td colspan="12">6. GPS coordinates:</td>\n    </tr>\n    <tr>\n      <td colspan="12">7. Source of case investigation information: <span class="variable"><strong>MalariaConnect</strong></span></td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section C: Questions to Patient</td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">1a. Is it the first time for the patient to have malaria:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div\n      </td>\n      <td colspan="6">1b. If no, please indicate when last did the patient have malaria: </td>\n    </tr>\n    <tr>\n      <td colspan="12">\n        <div style="float:left; margin-right: 13px;">\n          <span class="question">2a. Is the patient protecting her/himself against malaria:</span>\n          <div class="option_block">Yes</div>\n          <div class="option_block">No</div>\n        </div>\n      \n        <span class="question" style="margin-bottom:12px;">2b. If yes, please indicate how patient is protecting her/himself against malaria:</span><br/>\n        <span class="question">Repellents used on skin</span><div class="option_block empty"></div>\n        <span class="question">Coils</span><div class="option_block empty"></div>\n        <span class="question">Aerosol Mosquito Spray</span><div class="option_block empty"></div>\n        <span class="question">Bed net</span><div class="option_block empty"></div>\n        <span class="question">Prophylaxis</span><div class="option_block empty"></div>\n        <span class="question">Other</span><div class="option_block" style="width: 150px;"></div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">2c. Is the patient pregnant?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div\n      </td>\n      <td colspan="6">\n        <span class="question">3a. Has the patient's house been sprayed?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="6">3b. If yes, when last was the house sprayed?:</td>\n      <td colspan="6">\n        <span class="question">3c. What insecticide was used?:</span>\n        <div class="option_block">DDT</div><div class="option_block">Pyrethroid</div><div class="option_block">Carbamates</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="12">\n        <span class="question">3d. If no, what was the reason:</span><br/>\n        <span class="question">House Outside Spray Area</span><div class="option_block empty"></div>\n        <span class="question">Refusal</span><div class="option_block empty"></div>\n        <span class="question">Sick people in house</span><div class="option_block empty"></div>\n        <span class="question">House is usually locked</span><div class="option_block empty"></div>\n        <span class="question">Other</span><div class="option_block" style="width: 150px;"></div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="12">\n        <div style="float:left; margin-right:10px;">\n          <span class="question">4. Does the house/homestead have a hut card?:</span>\n          <div class="option_block">Yes</div>\n          <div class="option_block">No</div>\n          <div class="option_block">Not Applicable</div>\n        </div>\n        <span class="question" style="margin-bottom:12px;">5. Occupation of Patient:</span>\n        <span class="question">Mining</span><div class="option_block empty"></div>\n        <span class="question">Farming</span><div class="option_block empty"></div>\n        <span class="question">Truck Driver</span><div class="option_block empty"></div>\n        <br/><br/><span class="question">Taxi Driver</span><div class="option_block empty"></div>\n        <span class="question">Scholar/Student</span><div class="option_block empty"></div>\n        <span class="question">Self Employed</span><div class="option_block empty"></div>\n        <span class="question">Unemployed</span><div class="option_block empty"></div>\n        <span class="question">Other</span><div class="option_block" style="width: 150px;"></div>\n      </td>\n    </tr>\n    <tr>\n    </tr>\n    <tr>\n      <td colspan="12">6. When did you start feeling sick?:</td>\n    </tr>\n    <tr>\n      <td colspan="12">7. Where did the person travel to? <span class="variable"><strong>No</strong></span></td>\n    </tr>\n    <tr>\n      <td colspan="12"><table border="1" cellspacing="0" style="width: 100%; border-color: #DEDFDE;">\n        <tr>\n          <th>Country / Province visited</th>\n          <th>0-7 days before falling ill</th>\n          <th>8-21 days before falling ill</th>\n          <th>22-365 days before falling ill</th>\n\n        </tr>\n        <tr>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n        </tr>\n        <tr>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n        </tr>\n        <tr>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n          <td>&nbsp;</td>\n        </tr>\n      </table></td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section D: Investigation Outcome</td>\n    </tr>\n    <tr>\n      <td colspan="12">\n        <span class="question">1. Was the Source locality on the original form notification from (GW17/5) CORRECT prior to the verification during this case investigation?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="6">2. What is the final outcome on the case classification:</td>\n      <td colspan="6">\n        <span class="question">2a. Case Classification:</span>\n        <div class="option_block">Local</div>\n        <div class="option_block">Imported</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">2b. Diagnosis:</span>\n        <div class="option_block">RDT</div>\n        <div class="option_block">Blood Smear</div>\n        <div class="option_block">Both</div>\n      </td>\n      <td colspan="6">2c. Source Country:</td>\n    </tr>\n    <tr>\n      <td colspan="6">2d. Source Province: </td>\n      <td colspan="6">2e. Source District:</td>\n    </tr>\n    <tr>\n      <td colspan="6">2f. Source Municipality:</td>\n      <td colspan="6">2g. Source Locality:</td>\n    </tr>\n    <tr>\n      <td colspan="12">2h. GPS Coordinates for source of infection (if local case)</td>\n    </tr>\n    <tr>\n      <td colspan="12">\n        <span class="question">3. Parasite identified:</span>\n        <div class="option_block"><em>P. falciparum</em></div>\n        <div class="option_block"><em>P. ovale</em></div>\n        <div class="option_block"><em>P. vivax</em></div>\n        <div class="option_block"><em>P. malariae</em></div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section E: Tests Conducted In Community During Case Investigation</td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">1. Total community members <br/>tested with RDT:</span>\n        <div class="option_block"></div>\n        <div class="option_block"></div>\n        <div class="option_block">Not Applicable</div>\n      </td>\n      <td colspan="6">\n        <span class="question">2. Total RDT Positives:</span>\n        <div class="option_block"></div>\n        <div class="option_block"></div>\n        <div class="option_block">Not Applicable</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">3. Total blood smears collected:</span>\n        <div class="option_block"></div>\n        <div class="option_block"></div>\n        <div class="option_block">Not Applicable</div>\n      </td>\n      <td colspan="6">\n        <span class="question">4. Number of households visited:</span>\n        <div class="option_block"></div>\n        <div class="option_block"></div>\n        <div class="option_block">Not Applicable</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section F: Observations By Case Investigator</td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">1. Any breeding sites found?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div>\n        </td>\n      <td colspan="6">\n        <span class="question">2. Any action taken?</span><br/>\n        <span class="question">Water Drained</span><div class="option_block empty"></div>\n        <span class="question">Larvicide Applied<br/>(Specify type used)</span><div class="option_block empty"></div>\n        <span class="question">Other</span><div class="option_block" style="width: 100px;"></div>\n      </td>\n    </tr>\n    <tr style="vertical-align:top;height:60px;">\n      <td colspan="12">3. Other observations by case investigation officer (including entomological surveillance)?</td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">4. Follow-up Smear taken?:</span>\n        <div class="option_block">14 days</div>\n        <div class="option_block">21 Days</div>\n        <div class="option_block">28 Days</div>  \n      </td>\n      <td colspan="6">5. Case Investigator Signature:</td>\n    </tr>\n    <tr>\n      <td colspan="12" class="section_heading">Section G: Observations by Supervisor</td>\n    </tr>\n    <tr>\n      <td colspan="6">\n        <span class="question">1. Did the case investigator complete all the questions <br/> to make the correct classification?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div>\n      </td>\n      <td colspan="6">\n        <span class="question">4. Designation?:</span>\n        <div class="option_block">CDC</div>\n        <div class="option_block">EHP</div>\n        <div class="option_block">Case Investigator</div>\n        <div class="option_block">Team Leader</div>\n        <div class="option_block">MSA</div>\n      </td>\n    </tr>\n    <tr>\n      <td colspan="7">\n        <span class="question">2. Did the case investigator UPDATE the travel and other <br/> fields on the copy notification (GW 17/5)?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div>\n      </td>\n      <td colspan="5">5. Contact number?:</td>\n    </tr>\n    <tr>\n      <td colspan="7">\n        <span class="question">3. Was the Case Investigation Form checked by supervisor?:</span>\n        <div class="option_block">Yes</div>\n        <div class="option_block">No</div>\n      </td>\n      <td colspan="5">6. Date checked by supervisor?:</td>\n    </tr>\n    <tr>\n      <td colspan="6">Supervisor: </td>\n      <td colspan="6">Signature:</td>\n    </tr>\n\n  </table>\n</body>\n</html>	2015-11-24 09:52:41.556045+00	2015-11-24 09:52:41.556112+00
